  TResult? mapOrNull<TResult extends Object?>({
    TResult Function(WrongEmailOrPassword value)? wrongEmailOrPassword,
    TResult Function(UsedEmail value)? usedEmail,
    TResult Function(WeakPassword value)? weakPassword,
    TResult Function(forbiddenAccess value)? forbiddenAccess,
    TResult Function(UnAutherized value)? unAutherized,
    TResult Function(UnKnownError value)? unKnownError,
  }) {
    return unKnownError?.call(this);
  }

  @override
  @optionalTypeArgs
  TResult maybeMap<TResult extends Object?>({
    TResult Function(WrongEmailOrPassword value)? wrongEmailOrPassword,
    TResult Function(UsedEmail value)? usedEmail,
    TResult Function(WeakPassword value)? weakPassword,
    TResult Function(forbiddenAccess value)? forbiddenAccess,
    TResult Function(UnAutherized value)? unAutherized,
    TResult Function(UnKnownError value)? unKnownError,
    required TResult orElse(),
  }) {
    if (unKnownError != null) {
      return unKnownError(this);
    }
    return orElse();
  }
}

abstract class UnKnownError implements ClientFailure {
  const factory UnKnownError() = _$UnKnownError;
}
